        const optionIndex = parseInt(input.dataset.optionIndex);
        checkboxes[optionIndex].classList.toggle("checked");

        if (input.id === "other") {
          if (input.checked) {
            otherTextInput.classList.add("visible");
            otherTextInput.focus();
          } else {
            otherTextInput.classList.remove("visible");
            otherTextInput.value = "";
          }
        }
      }

      function onCheckboxClick(e) {
        const input = e.target
          .closest(".survey-option-wrapper")
          .querySelector("input");
        input.click();
      }

      function submitOnClick() {
        appboyBridge.logClick("submit_survey_button");

        // we sort the array so answers will always be in the same order (easier for the query later)
        const multiSelectAnswer = choices
          .filter(function (input) {
            return input.checked;
          })
          .map((input) => {
            return input.dataset.multiProductSurveyChoice;
          })
          .sort();
        const otherTextInputValue = otherTextInput.value;

        // if nothing is selected, show an error and don't submit
        if (multiSelectAnswer.length === 0) {
          errorMessage.classList.add("show");
          return;
        }

        const userAnswers = {
          multiSelectAnswer,
          specifiedOtherAnswer: otherTextInputValue,
        };

        getBigBrain()?.("track", BRAZE_IN_APP_SURVEY_SUBMIT, {
          data: { userAnswers },
          info1: SURVEY_ID,
        });

        appboyBridge
          .getUser()
          .setCustomUserAttribute(
            MULTI_PRODUCT_SURVEY_MULTI_CHOICE_BRAZE_ATTRIBUTE,
            multiSelectAnswer
          );

        appboyBridge
          .getUser()
          .setCustomUserAttribute(
            MULTI_PRODUCT_SURVEY_SPECIFIED_OTHER_BRAZE_ATTRIBUTE,
            otherTextInputValue
          );

        setSuccessState();
        appboyBridge.requestImmediateDataFlush();

        // give it some time to show the success state before closing the message
        setTimeout(() => {
          appboyBridge.closeMessage();
        }, 1000);
      }

      function setSuccessState() {
        errorMessage.classList.remove("show");
        submitButton.classList.add("success");
        submitButton.value = "Thank you!";
      }

      // END OF DEFINITIONS, START OF EXECUTION
      getBigBrain()?.("track", BRAZE_IN_APP_SURVEY_SHOWED, {
        info1: SURVEY_ID,
      });

      // randomize the order of choices
      shuffleArray(optionsOrderArray);
      wmWrapper.style.order = optionsOrderArray[0];
      crmWrapper.style.order = optionsOrderArray[1];
      devWrapper.style.order = optionsOrderArray[2];
      otherWrapper.style.order = 4;

      // add event listeners
      choices.forEach(function (input) {
        input.addEventListener("click", onOptionClick);
      });
      checkboxes.forEach(function (checkbox) {
        checkbox.addEventListener("click", onCheckboxClick);
      });
      submitButton.addEventListener("click", submitOnClick);
      closeButton.addEventListener("click", closeSurveyOnClick);
    </script>
